const LOS_FULL_MASK = 0x20000;
const LOS_EAST_MASK = 0x1000;
const LOS_WEST_MASK = 0x10000;
const LOS_NORTH_MASK = 0x400;
const LOS_SOUTH_MASK = 0x4000;

const MOVE_FULL_MASK = 0x100 | 0x200000 | 0x40000; // 0x100 for objects, 0x200000 for unwalkable tiles such as water etc, 0x40000 is very rare but BA cannon has it.
const MOVE_EAST_MASK = 0x8;
const MOVE_WEST_MASK = 0x80;
const MOVE_NORTH_MASK = 0x2;
const MOVE_SOUTH_MASK = 0x20;

const CHECK_LOS_RUNNER = 0;
const CHECK_LOS_PLAYER = 1;
const CHECK_LOS_NPC_TO_PLAYER = 2;

var canvas;
var context;
var tileSize;

var currentMap;
var losCheckType;
var selectedTileX;
var selectedTileY;

var prevSelectedTileX;
var prevSelectedTileY;

var imageData;
var pixels;
var drawColorR;
var drawColorG;
var drawColorB;
var drawColorA;

function start() {
    canvas = document.getElementById(HTML_LOSCANVAS_ID)
    canvas.onmousedown = onMouseDown;
    context = canvas.getContext("2d");
    
    currentMap = wave1to9;
    losCheckType = CHECK_LOS_PLAYER;
    selectedTileX = -1;
    prevSelectedTileX = -1;
    
    setTileSize(12);
}

function setWave1To9() {
    currentMap = wave1to9;
    drawAll();
}

function setWave10() {
    currentMap = wave10;
    drawAll();
}

function setInferno() {
    currentMap = inferno;
    drawAll();
}

function onNpcSizeChanged() {
    if (losCheckType === CHECK_LOS_NPC_TO_PLAYER) {
        drawAll();
    }
}

function setLOSCheckType(type) {
    if (losCheckType === type) {
        selectedTileX = -1;
    } else {
        losCheckType = type;
    }
    drawAll();
}

function increaseSize() {
    setTileSize(tileSize + 1);
}

function decreaseSize() {
    if (tileSize > 1) {
        setTileSize(tileSize - 1);
    }
}

function setTileSize(size) {
    tileSize = size;
    canvas.width = tileSize * 64;
    canvas.height = tileSize * 64;
    imageData = context.createImageData(canvas.width, canvas.height);
    pixels = imageData.data;
    drawAll();
}

function onPlayerRangeChanged() {
    if (losCheckType === CHECK_LOS_PLAYER) {
        drawAll();
    }
}

function onMouseDown(e) {
    var canvasRect = canvas.getBoundingClientRect();
    prevSelectedTileX = selectedTileX;
    prevSelectedTileY = selectedTileY;
    selectedTileX = Math.trunc((e.clientX - canvasRect.left) / tileSize);
    selectedTileY = Math.trunc((canvasRect.bottom - 1 - e.clientY) / tileSize);
    drawAll();
}

function getTileFlag(x, y) {
    return currentMap[x + y * 64];
}

function setAllPixels() {
    for (var i = 0; i < canvas.width*canvas.height*4; i += 4) {
        pixels[i] = drawColorR;
        pixels[i + 1] = drawColorG;
        pixels[i + 2] = drawColorB;
        pixels[i + 3] = 255;
    }
}

function setPixel(x, y) {
    var i = ((canvas.height - 1 - y) * canvas.width + x) * 4;
    
    var r = pixels[i] + drawColorA * (drawColorR - pixels[i]) / 255;
    var g = pixels[i + 1] + drawColorA * (drawColorG - pixels[i + 1]) / 255;
    var b = pixels[i + 2] + drawColorA * (drawColorB - pixels[i + 2]) / 255;
    pixels[i] = r;
    pixels[i + 1] = g;
    pixels[i + 2] = b;
    pixels[i + 3] = 255;
}

function setDrawColor(r, g, b, a) {
    drawColorR = r;
    drawColorG = g;
    drawColorB = b;
    drawColorA = a;
}

function fillTile(tileX, tileY) {
    for (var x = tileX * tileSize; x < (tileX + 1) * tileSize; ++x) {
        for (var y = tileY * tileSize; y < (tileY + 1) * tileSize; ++y) {
            setPixel(x, y);
        }
    }
}

function fillTileItem(tileX, tileY) {
    var padding = tileSize >>> 2;
    for (var x = tileX * tileSize + padding; x < (tileX + 1) * tileSize - padding; ++x) {
        for (var y = tileY * tileSize + padding; y < (tileY + 1) * tileSize - padding; ++y) {
            setPixel(x, y);
        }
    }
}

function outlineTile(tileX, tileY) {
    var x = tileX * tileSize;
    for (var y = tileY * tileSize; y < (tileY + 1) * tileSize; ++y) {
        setPixel(x, y);
    }
    var y = tileY * tileSize;
    for (var x = tileX * tileSize + 1; x < (tileX + 1) * tileSize; ++x) {
        setPixel(x, y);
    }
    x = (tileX + 1) * tileSize - 1;
    for (var y = tileY * tileSize + 1; y < (tileY + 1) * tileSize; ++y) {
        setPixel(x, y);
    }
    y = (tileY + 1) * tileSize - 1;
    for (var x = tileX * tileSize + 1; x < (tileX + 1) * tileSize - 1; ++x) {
        setPixel(x, y);
    }
}

function outlineBig(tileX, tileY, size) {
    for (var x = tileX; x < tileX + size; ++x) {
        southLine(x, tileY);
        northLine(x, tileY + size - 1);
    }
    for (var y = tileY; y < tileY + size; ++y) {
        westLine(tileX, y);
        eastLine(tileX + size - 1, y);
    }
}

function westLine(tileX, tileY) {
    var x = tileX * tileSize;
    for (var y = tileY * tileSize; y < (tileY + 1) * tileSize; ++y) {
        setPixel(x, y);
    }
}

function eastLine(tileX, tileY) {
    var x = (tileX + 1) * tileSize - 1;
    for (var y = tileY * tileSize; y < (tileY + 1) * tileSize; ++y) {
        setPixel(x, y);
    }
}

function southLine(tileX, tileY) {
    var y = tileY * tileSize;
    for (var x = tileX * tileSize; x < (tileX + 1) * tileSize; ++x) {
        setPixel(x, y);
    }
}

function northLine(tileX, tileY) {
    var y = (tileY + 1) * tileSize - 1;
    for (var x = tileX * tileSize; x < (tileX + 1) * tileSize; ++x) {
        setPixel(x, y);
    }
}

function spike(tileX, tileY) {
    var x = tileX * tileSize;
    var y = tileY * tileSize;
    var endX = x + tileSize - 1;
    endI = (tileSize >>> 1) + (tileSize & 1);
    
    for (var i = 0; i < endI; ++i) {
        setPixel(x + i, y);
        setPixel(endX - i, y);
        ++y;
    }
}

function drawAll() {
    drawMap();
    drawDetails();
    drawLOS();
    drawGrid();
    drawOverlays();
    context.putImageData(imageData, 0, 0);
}

function drawLOS() {
    if (selectedTileX === -1) {
        return;
    }
    setDrawColor(0, 240, 0, 92);
	if (losCheckType === CHECK_LOS_NPC_TO_PLAYER) {
        var npcSize = Number(document.getElementById(HTML_NPCSIZE_ID).value);
        if (npcSize < 1) {
            npcSize = 1;
        }
        for (var x = Math.max(selectedTileX - 15, 0); x <= Math.min(selectedTileX + npcSize + 14, 63); ++x) {
            for (var y = Math.max(selectedTileY - 15, 0); y <= Math.min(selectedTileY + npcSize + 14, 63); ++y) {
                var destX;
                var destY;
                if (x < selectedTileX) {
                    destX = selectedTileX;
                } else if (x >= selectedTileX + npcSize) {
                    destX = selectedTileX + npcSize - 1;
                } else {
                    destX = x;
                }
                if (y < selectedTileY) {
                    destY = selectedTileY;
                } else if (y >= selectedTileY + npcSize) {
                    destY = selectedTileY + npcSize - 1;
                } else {
                    if (destX === x) {
                        continue;
                    }
                    destY = y;
                }
                if (hasLineOfSight(x, y, destX, destY) && (getTileFlag(x, y) & LOS_FULL_MASK) === 0) {
                    fillTile(x, y);
                }
            }
        }
    } else if (losCheckType === CHECK_LOS_RUNNER) {
        var xOffset = selectedTileX % 8;
        var yOffset = selectedTileY % 8;
        for (var x = Math.max(selectedTileX - 8 - xOffset, 0); x <= Math.min(selectedTileX + 15 - xOffset, 63); ++x) {
           for (var y = Math.max(selectedTileY - 8 - yOffset, 0); y <= Math.min(selectedTileY + 15 - yOffset, 63); ++y) {
                if (hasLineOfSight(selectedTileX, selectedTileY, x, y) && (getTileFlag(x, y) & LOS_FULL_MASK) === 0) {
                    fillTile(x, y);
                }
            }
        }
    } else {
        var range = Number(document.getElementById(HTML_PLAYERRANGE_ID).value);
        for (var x = Math.max(selectedTileX - range, 0); x <= Math.min(selectedTileX + range, 63); ++x) {
           for (var y = Math.max(selectedTileY - range, 0); y <= Math.min(selectedTileY + range, 63); ++y) {
                if (hasLineOfSight(selectedTileX, selectedTileY, x, y) && (getTileFlag(x, y) & LOS_FULL_MASK) === 0) {
                    fillTile(x, y);
                }
            }
        }
    }
    setDrawColor(0, 255, 255, 255);
    fillTile(selectedTileX, selectedTileY);
    if (losCheckType === CHECK_LOS_NPC_TO_PLAYER && npcSize > 1) {
        outlineBig(selectedTileX, selectedTileY, npcSize);
    }
}

function drawDetails() {
    if (currentMap !== wave1to9 && currentMap !== wave10) {
        return;
    }
    setDrawColor(160, 82, 45, 255);
    spike(40, 40);
    spike(40, 39);
    spike(41, 40);
    spike(41, 39);
    spike(43, 39);
    
    spike(36, 42);
    spike(36, 43);
    spike(37, 42);
    spike(37, 43);
    
    spike(39, 44);
    
    spike(43, 30);
    spike(43, 31);
    spike(44, 30);
    spike(44, 31);
    
    spike(45, 32);
    
    if (currentMap === wave1to9) {
        fillTileItem(29, 46);
        fillTileItem(28, 47);
    } else {
        fillTileItem(30, 46);
        fillTileItem(29, 47);
    }
    setDrawColor(127, 127, 127, 255);
    fillTileItem(32, 42);
}

function drawOverlays() {
    if (currentMap === inferno) {
        setDrawColor(240, 20, 20, 255);
        outlineBig(18, 18, 2);
        outlineBig(18, 18, 3);
        outlineBig(18, 18, 4);
        outlineBig(22, 23, 2);
        outlineBig(22, 23, 3);
        outlineBig(22, 23, 4);
        outlineBig(32, 18, 2);
        outlineBig(32, 18, 3);
        outlineBig(32, 18, 4);
        outlineBig(40, 21, 2);
        outlineBig(40, 21, 3);
        outlineBig(40, 21, 4);
        outlineBig(33, 29, 2);
        outlineBig(33, 29, 3);
        outlineBig(33, 29, 4);
        outlineBig(40, 34, 2);
        outlineBig(40, 34, 3);
        outlineBig(40, 34, 4);
        outlineBig(39, 41, 2);
        outlineBig(39, 41, 3);
        outlineBig(39, 41, 4);
        outlineBig(18, 41, 2);
        outlineBig(18, 41, 3);
        outlineBig(18, 41, 4);
        outlineBig(20, 35, 2);
        outlineBig(20, 35, 3);
        outlineBig(20, 35, 4);
        //zuk
        outlineBig(28, 52, 7);
        //nibblers
        setDrawColor(0, 0, 255, 255);
        outlineBig(25, 33, 3);
        return;
    }
    
    if (currentMap !== wave1to9 && currentMap !== wave10) {
        return;
    }
    
    // Spawns and stuff
    setDrawColor(160, 82, 45, 255);
    outlineTile(45, 34);
    outlineTile(15, 33);

    setDrawColor(255, 0, 0, 255);
    if (currentMap === wave1to9) {
        outlineTile(18, 45);
    } else {
        outlineTile(18, 46);
    }
    outlineTile(24, 47);
    setDrawColor(0, 0, 255, 255);
    if (currentMap === wave1to9) {
        outlineTile(36, 47);
    } else {
        outlineTile(42, 46);
    }
    setDrawColor(0, 255, 0, 255);
    if (currentMap === wave1to9) {
        outlineTile(42, 45);
    } else {
        outlineTile(36, 47);
    }
}

function drawGrid() {
    for (var tileX = 0; tileX < 64; ++tileX) {
        if (tileX % 8 == 7) {
            setDrawColor(0, 0, 0, 72);
        } else {
            setDrawColor(0, 0, 0, 48);
        }
        var x = (tileX + 1) * tileSize - 1;
        for (var y = 0; y < tileSize * 64; ++y) {
            setPixel(x, y);
        }
    }
    for (var tileY = 0; tileY < 64; ++tileY) {
        if (tileY % 8 == 7) {
            setDrawColor(0, 0, 0, 72);
        } else {
            setDrawColor(0, 0, 0, 48);
        }
        var y = (tileY + 1) * tileSize - 1;
        for (var x = 0; x < tileSize * 64; ++x) {
            setPixel(x, y);
        }
    }
}

function drawMap() {
    setDrawColor(206, 183, 117, 255);
    setAllPixels();
    for (var y = 0; y < 64; ++y) {	
        for (var x = 0; x < 64; ++x) {
            if ((getTileFlag(x, y) & LOS_FULL_MASK) !== 0) {
                setDrawColor(0, 0, 0, 255);
                fillTile(x, y);
            } else  {
                if ((getTileFlag(x, y) & MOVE_FULL_MASK) !== 0) {
                    setDrawColor(127, 127, 127, 255);
                    fillTile(x, y);
                }
                if ((getTileFlag(x, y) & LOS_EAST_MASK) !== 0) {
                    setDrawColor(0, 0, 0, 255);
                    eastLine(x, y);
                } else if ((getTileFlag(x, y) & MOVE_EAST_MASK) !== 0) {
                    setDrawColor(127, 127, 127, 255);
                    eastLine(x, y);
                }
                if ((getTileFlag(x, y) & LOS_WEST_MASK) !== 0) {
                    setDrawColor(0, 0, 0, 255);
                    westLine(x, y);
                } else if ((getTileFlag(x, y) & MOVE_WEST_MASK) !== 0) {
                    setDrawColor(127, 127, 127, 255);
                    westLine(x, y);
                }
                if ((getTileFlag(x, y) & LOS_NORTH_MASK) !== 0) {
                    setDrawColor(0, 0, 0, 255);
                    northLine(x, y);
                } else if ((getTileFlag(x, y) & MOVE_NORTH_MASK) !== 0) {
                    setDrawColor(127, 127, 127, 255);
                    northLine(x, y);
                }
                if ((getTileFlag(x, y) & LOS_SOUTH_MASK) !== 0) {
                    setDrawColor(0, 0, 0, 255);
                    southLine(x, y);
                } else if ((getTileFlag(x, y) & MOVE_SOUTH_MASK) !== 0) {
                    setDrawColor(127, 127, 127, 255);
                    southLine(x, y);
                }
            }
        }
    }
}

function hasLineOfSight(x1, y1, x2, y2) {
    var dx = x2 - x1;
    var dxAbs = Math.abs(dx);
    var dy = y2 - y1;
    var dyAbs = Math.abs(dy);
    
    if (dxAbs > dyAbs) {
        var xTile = x1;
        var y = y1 << 16;
        var slope = Math.trunc((dy << 16) / dxAbs); // Integer division
        
        var xInc;
        var xMask;
        if (dx > 0) {
            xInc = 1;
            xMask = LOS_WEST_MASK | LOS_FULL_MASK;
        } else {
            xInc = -1;
            xMask = LOS_EAST_MASK | LOS_FULL_MASK;
        }
        var yMask;
        y += 0x8000;
        if (dy < 0) {
            y -= 1; // For correct rounding
            yMask = LOS_NORTH_MASK | LOS_FULL_MASK;
        } else {
            yMask = LOS_SOUTH_MASK | LOS_FULL_MASK;
        }
        
        while (xTile !== x2) {
            xTile += xInc;
            var yTile = y >>> 16;
            if ((getTileFlag(xTile, yTile) & xMask) !== 0) {
                return false;
            }
            y += slope;
            var newYTile = y >>> 16;
            if (newYTile !== yTile && (getTileFlag(xTile, newYTile) & yMask) !== 0) {
                return false;
            }
        }
    } else {
        var yTile = y1;
        var x = x1 << 16;
        var slope = Math.trunc((dx << 16) / dyAbs); // Integer division
        
        var yInc;
        var yMask;
        if (dy > 0) {
            yInc = 1;
            yMask = LOS_SOUTH_MASK | LOS_FULL_MASK;
        } else {
            yInc = -1;
            yMask = LOS_NORTH_MASK | LOS_FULL_MASK;
        }
        
        var xMask;
        x += 0x8000;
        if (dx < 0) {
            x -= 1; // For correct rounding
            xMask = LOS_EAST_MASK | LOS_FULL_MASK;
        } else {
            xMask = LOS_WEST_MASK | LOS_FULL_MASK;
        }
        
        while (yTile !== y2) {
            yTile += yInc;
            var xTile = x >>> 16;
            if ((getTileFlag(xTile, yTile) & yMask) !== 0) {
                return false;
            }
            x += slope;
            var newXTile = x >>> 16;
            if (newXTile !== xTile && (getTileFlag(newXTile, yTile) & xMask) !== 0) {
                return false;
            }
        }
    }
    return true;
}















